V případě následujících právních jednání je za společnost oprávněn jednat společně předseda představenstva a člen představenstva A:
a)poskytování finančních prostředků formou úvěrů či zápůjček, které ve svém souhrnu vůči jedné osobě (včetně osob s ní spojených) přesahují částku 500 000,- Kč (slovy: pět set tisíc korun českých) za jedno účetní období;
b)uzavírání smluv, na jejichž základě se společnost zaváže k plnění přesahující svou hodnotou (byť ve svém souhrnu) částku 10 000 000,- Kč (slovy: deset miliónů korun českých), mimo smluv o nákupu zboží prodávaného společností v rámci běžného obchodního s tyku;
c)převod nebo zastavení podniku (závodu) společnosti nebo jeho části; a
d)zcizení ochranných známek, domén a jiných práv duševního vlastnictví společností nebo zatížení ochranných známek, domén a jiných práv duševního vlastnictví společnosti právy třetích osob.
Ve zbylých případech je za společnost oprávněn jednat samostatně předseda představenstva.
